import {Implementation} from '../impl/impl';
import { SiteContent } from '../site/site';


 export class api{
    private impl :Implementation = new Implementation('');

    createMenu():SiteContent.Menu[]{
        return this.impl.createMenu();
    }

    createIntro():string{
        return this.impl.createIntro();
    }
}
